@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})
export class AppComponent {
  title = 'Gestion Employees';
}
<div class="title bg-primary">
  <h1> {{title}} </h1>

</div>

<div class="container">
  <router-outlet></router-outlet>
</div>
<footer class="footer">
  <div class="container">
    <span>All Rights Reserved @Emm</span>
  </div>
</footer>
